import React from "react";
import Footer from "../layout/Footer";
import MainHeader from "../layout/MainHeader";

const Login = () => {
  return (
    <div>
      <MainHeader />
      <h1>Login</h1>
      <Footer />
    </div>
  );
};

export default Login;
